import './App.css';
import React from 'react'
import { BrowserRoute, Routes, Route } from 'react-router-dom'
import AuthorsDisplay from './Components/AuthorsDisplay';

function App() {
  return (
    <BrowserRoute>
      <div className="App">
        <Routes>
          <Route path="/authors" element={<AuthorsDisplay />} />
        </Routes>
      </div>
    </BrowserRoute>
  );
}

export default App;
